import React,{useState} from "react";
import cancel from '../components/images/cancel.jpg';
import black_x from '../components/images/black_x.jpg';
import google from "../components/images/google.png";
import apple from "../components/images/apple.png";
// import ReactDOM from "react-dom";

const Signin = () => {
  const [user, setDetails] = useState({ username: "" }); // State for username

  const handleChange = (event) => {
    const { name, value } = event.target;
    setDetails({ ...user, [name]: value });
  };
return (
    <form className="main_sign">
      <div className="sign-in"><a href="/public">
        <img className="cross" height="20px" width="20px" src={cancel} alt="img" /></a>
        <div className="nav_1">
          <div className="for-x">
            <div>
              <img
                height="60px"
                width="60px"
                className="x-mark"
                src={black_x}
                alt="x-mark"
              />
            </div>
          </div>
        </div>
        <div className="down-box">
          <div className="content">
          <h2>Sign In To X</h2>
          <div className="box_"><img height='30px' src={google} alt="google"/>Sign In With Google</div>
          <div className="box_"><img height='30px' src={apple} alt="apple"/> Sign In With Apple</div>
          <div className="lin_main">
          <div className="lin"></div><div className="text">or</div><div className="lin"></div></div>
      <input
        className="input"
        type="text"
        name="username"
        onChange={handleChange}
        placeholder="Phone, email, or username"
      />
          <div className="box_ nex">Next</div>
          <div className="box_">Forgot password?</div>
          <div className="text">Don,t have an account? <a href="/create">Sign Up</a></div>
          </div>
          <div />
        </div>
      </div>
    </form>
  );
}



export default Signin;
